    // {setPosts({...posts,[e.target.name]:e.target.value})}
    setPosts(e.target.value)
    
  })
  const clickit=()=>{
    setData(true)
  }
    return (
      <div>
        <button onClick={clickit}>PrintNames</button>
        <input type='text'  value={posts.firstname} onChange={clickHandler} ></input>
        <input type='text'  value={posts.lastname} onChange={clickHandler} ></input>
        {
          data?
        <div>{posts.firstname}</div>
        
        :false
}
      </div>
    );
  }
  
